window.bookSummaryJSON = "<p>A wildly successful innovator to rival Steve Jobs or Elon Musk, Vivian Liao is prone to radical thinking, quick decision-making, and reckless action. On the eve of her greatest achievement, she seeks to outrun people who are trying to steal her success.&nbsp;</p> <p>In the chilly darkness of a Boston server farm, she sets her ultimate plan into motion. A terrifying instant later, she is catapulted through space and time to a far future where she confronts a destiny stranger and more deadly than she could ever imagine.&nbsp;</p> <p>The end of time is ruled by an ancient, powerful Empress who blesses or blasts entire planets with a single thought. Rebellion is literally impossible to consider - until Vivian Liao arrives. Trapped between the Pride - a ravening horde of sentient machines - and a fanatical sect of warrior monks who call themselves the Mirrorfaith, Viv must rally a strange group of allies to confront the Empress and find a way back to the world and life she left behind.</p>"; 
